import React from "react";
import {
  TeamCardContainer,
  TeamCard,
  TeamContainer,
  TeamText,
} from "./styling/Team.styled";

import TestImg from "../images/hero.svg";

const Team = () => {
  return (
    <>
      <TeamContainer>
        <TeamText>
          <h1>Meet our Founders</h1>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Convallis
            suscipit ut in consectetur quis dapibus facilisi semper.
          </p>
        </TeamText>
        <TeamCardContainer>
          <TeamCard>
            <img src={TestImg} alt="" />
          </TeamCard>
        </TeamCardContainer>
      </TeamContainer>
    </>
  );
};

export default Team;
